DROP DATABASE IF EXISTS `mockdata`;
CREATE DATABASE `mockdata` default character set utf8;

USE  `mockdata`
DROP TABLE if exists `company`;

CREATE TABLE `company` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `company` varchar(255) default NULL,
  `group` varchar(255) default NULL,
  `region` varchar(255) default NULL,
  `industry` varchar(255) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1 default charset=utf8;
set character set utf8;


DROP TABLE if exists `server`;
CREATE TABLE `server` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `ip` TEXT default NULL,
  `mac` varchar(36) NOT NULL,
  `desciption` varchar(255) default NULL,
  `company` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1 default charset=utf8;

set character set utf8;


DROP TABLE if exists `company_sn`;
CREATE TABLE `company_sn` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `company` mediumint default NULL,
  `sn` varchar(36) NOT NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


DROP TABLE if exists `company_monthly`;
CREATE TABLE `company_monthly` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `year` TEXT default NULL,
  `month` mediumint default NULL,
  `activity_sum` mediumint default NULL,
  `activity_max` mediumint default NULL,
  `activity_avg` mediumint default NULL,
  `install_sum` mediumint default NULL,
  `install_max` mediumint default NULL,
  `install_avg` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


DROP TABLE if exists `company_daily`;
CREATE TABLE `company_daily` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `year` TEXT default NULL,
  `month` mediumint default NULL,
  `day` mediumint default NULL,
  `activity_sum` mediumint default NULL,
  `install_sum` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


DROP TABLE if exists `company_install`;
CREATE TABLE `company_install` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `sum` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


DROP TABLE if exists `sn_activity_daily`;
CREATE TABLE `sn_activity_daily` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `sn` mediumint default NULL,
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `year` TEXT default NULL,
  `month` mediumint default NULL,
  `day` mediumint default NULL,
  `sum` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


DROP TABLE if exists `sn_activity_monthly`;
CREATE TABLE `sn_activity_monthly` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `sn` mediumint default NULL,
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `year` TEXT default NULL,
  `month` mediumint default NULL,
  `sum` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


DROP TABLE if exists `version_activity_daily`;
CREATE TABLE `version_activity_daily` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `version` varchar(255),
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `year` TEXT default NULL,
  `month` mediumint default NULL,
  `day` mediumint default NULL,
  `sum` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


DROP TABLE if exists `version_activity_month`;
CREATE TABLE `version_activity_month` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `version` varchar(255),
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `year` TEXT default NULL,
  `month` mediumint default NULL,
  `sum` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

